import React,{useState} from 'react'
import { LinearProgress, Box } from '@mui/material';

const ProgressBar = () => {
    const [progress, setProgress] = useState(69);
    return (
        <>
        <Box p={5}>
          <LinearProgress variant="determinate" value = {progress} />  
          </Box>
        </>
    )
}

export default ProgressBar
